INSERT INTO `gz_article` VALUES ('71', '47', '再学AS3（五）：鼠绘', '', '', '<p>知识点：<br />\r\n1、添加鼠标监听事件MouseEvent；<br />\r\n2、规定画布大小；<br />\r\n3、moveTo和lineTo；<br />\r\n4、绘制开始与结束判断。</p>\r\n<p>代码：</p>\r\n<div class=\"HtmlCode\">var&nbsp;huabu:Sprite=new&nbsp;Sprite(); <br />\r\nhuabu.graphics.beginFill(0xFFFFFF); <br />\r\nhuabu.graphics.drawRect(20,20,510,360); <br />\r\nhuabu.graphics.endFill(); <br />\r\naddChild(huabu); <br />\r\nvar&nbsp;_drawing:Boolean; <br />\r\nvar&nbsp;quxian:Sprite=new&nbsp;Sprite(); <br />\r\nquxian.graphics.lineStyle(&nbsp;2,&nbsp;0xFF0000&nbsp;); <br />\r\nhuabu.addChild(quxian); <br />\r\n_drawing&nbsp;=&nbsp;false; <br />\r\nhuabu.addEventListener(&nbsp;MouseEvent.MOUSE_DOWN,&nbsp;startDrawing&nbsp;); <br />\r\nhuabu.addEventListener(&nbsp;MouseEvent.MOUSE_MOVE,moving); <br />\r\nhuabu.addEventListener(&nbsp;MouseEvent.MOUSE_UP,&nbsp;stopDrawing&nbsp;); <br />\r\nstage.addEventListener(MouseEvent.MOUSE_UP,stopDrawing); <br />\r\nfunction&nbsp;startDrawing(&nbsp;event:MouseEvent&nbsp;):void&nbsp;{ <br />\r\n&nbsp;quxian.graphics.moveTo(&nbsp;mouseX,&nbsp;mouseY&nbsp;); <br />\r\n&nbsp;_drawing&nbsp;=&nbsp;true; <br />\r\n} <br />\r\nfunction&nbsp;moving(&nbsp;event:MouseEvent&nbsp;):void&nbsp;{ <br />\r\n&nbsp;if&nbsp;(&nbsp;_drawing&nbsp;)&nbsp;{ <br />\r\n&nbsp;&nbsp;quxian.graphics.lineTo(&nbsp;mouseX,&nbsp;mouseY&nbsp;); <br />\r\n&nbsp;} <br />\r\n} <br />\r\nfunction&nbsp;stopDrawing(&nbsp;event:MouseEvent&nbsp;):void&nbsp;{ <br />\r\n&nbsp;_drawing&nbsp;=&nbsp;false; <br />\r\n}</div>', '11', '', null, null, '', '0', '1', '0', '0', '1328085032', '1328085032', '', '知识点：\r\n1、添加鼠标监听事件MouseEvent；\r\n2、规定画布大小；\r\n3、moveTo和lineTo；\r\n4、绘制开始与结束判断。', '', '50', '0', '0', '0', null, null);
INSERT INTO `gz_article` VALUES ('70', '47', 'Flex应用程序的性能优化', '', '', '<p>众所周知，flex应用程序存或多或少地存在性能方面的问题。特别是企业级大数量的应用程序，通常的解决办法是分模块加载，分时加载数据等措施来解决。下面我们来谈一谈代码级别的优化：</p>\r\n<p>1.尽可能减少程序的不必要运算。如下两种表达式：</p>\r\n<p>var a:unit = b+(1024-200)/2;&nbsp;&nbsp;&nbsp; <br />\r\nvar a:unit = b+412;&nbsp; <br />\r\n很明显下面的那个表达式运算更快。</p>\r\n<p>2.尽可能地采用乘法运算来代替除法运算。如下两个表达式：</p>\r\n<p>result = num / 4;&nbsp;&nbsp;&nbsp; <br />\r\nreuslt = num * 0.25; <br />\r\n经过统计工具计算，乘法比除法能节约150ms的时间。</p>\r\n<p>3.尽可能使用强类型。比如：</p>\r\n<p>var pt:Object = {x:x,y:y};&nbsp;&nbsp;&nbsp; <br />\r\nvar pt:Point = new Point(x,y);&nbsp; <br />\r\n<br />\r\n4.使用隐式类型转换。比如，</p>\r\n<p>var pt:Point = points[i] as Point;&nbsp;&nbsp;&nbsp; <br />\r\nvar pt:Point = points[i];&nbsp; <br />\r\n第二个的表达式使用的隐式类型转换，这样能节省开销。</p>\r\n<p>5.强制转换有时要比用as转换好用。如：</p>\r\n<p>pt = points[(i*2) as unit];&nbsp;&nbsp;&nbsp; <br />\r\npt = points[uint(i*2)];&nbsp; <br />\r\n<br />\r\n6.设置条件表达式的优先级。如：</p>\r\n<p>if(expensiveTest() &amp;&amp; usuallyFalse)&nbsp;&nbsp;&nbsp; <br />\r\nif(usuallyFalse &amp;&amp; expensiveTest()) <br />\r\n在与运算时，应将在多数情况下为false的表达式放在前面(如第二个表达式的写法)。</p>\r\n<p>7.for循环语句中的循环条件值应为一个固定值。如：</p>\r\n<p>for (var i=0; i&lt;arr.length; i++)&nbsp;&nbsp;&nbsp; <br />\r\nfor (var i=0; i&lt;l; i++)&nbsp; <br />\r\n应采用第二种写法，将arr的length属性值存放到一个变量中去。</p>\r\n<p>8.回调事件要比单独派发的事件要快，更比冒泡的事件快。</p>\r\n<p>9.尽量减少使用try...catch来抛出异常信息。如：</p>\r\n<p>try {isNull.x = 3;} catch(e:*) {}&nbsp;&nbsp;&nbsp; <br />\r\nif(isNull) {isNull.x = 3;}&nbsp; <br />\r\n多采用第二种方法，来减少异常。</p>\r\n<p>10.使用removeEventListener方法来清除闲置的事件侦听者。</p>', '13', '', null, null, '', '0', '1', '0', '0', '1328085001', '1328085001', '', '众所周知，flex应用程序存或多或少地存在性能方面的问题。特别是企业级大数量的应用程序，通常的解决办法是分模块加载，分时加载数据等措施来解决。下面我们来谈一谈代码级别的优化：', '', '50', '0', '0', '0', null, null);
INSERT INTO `gz_article` VALUES ('69', '47', 'Flash在某些多标签浏览器中的“伪沙箱”问题', '', '', '<p>在Flash播放器运行时，将不同来源的资源划分到独立的沙箱(sandbox)内，不同沙箱之间不能彼此操作数据（除非目标沙箱做过一些设置，授权其他沙箱可访问），这就是Flash的跨沙箱问题。当Flash文件(.swf) 和页面(.html)不在同一个域名下时，如果不经过Flash内部声明System.allowDomain，html无法访问flash定义的接口；不经过html设置allowScriptAccess为’always’，Flash也无法调用页面上的js函数。</p>\r\n<p>那么如果html和flash都设置了互相可以访问，是否Flash和html之间就可以互相访问了呢？理论上是的，然而实际上却不是。</p>\r\n<p><span></span></p>\r\n<p>在Chrome、Firefox等非IE浏览器上，是没有问题的。在“纯正”的IE6、IE7、IE8上也是正常的。但是在傲游、360浏览器、腾讯浏览器等<strong><span style=\"color:#ff0000;font-size:medium;\">基于IE的多标签浏览器</span></strong>中，<strong>刷新</strong>页面的时候，Flash播放器还是会抛安全沙箱错误。</p>\r\n<p><a href=\"http://q.pnq.cc/works/test/test-dmm-crssmn.html\" target=\"_blank\">点击访问测试页面</a>。</p>\r\n<p>使用上面说的“基于IE的多标签浏览器”访问，你会看到，第一次是正常的，刷新之后就不正常。如果你安装的是debug版本的播放器，可以看到Flash运行时发生了异常。</p>', '11', '', null, null, '', '0', '1', '0', '0', '1328084958', '1328084958', '', 'Flash在某些多标签浏览器中的“伪沙箱”问题', '', '50', '0', '0', '0', null, null);
