INSERT INTO `gz_article` VALUES ('59', '32', 'fdasfda', '', '', '<img src=\"http://192.168.1.189:8080/fenghuo/photos/attached/1_ipbcpk.gif\" alt=\"\" border=\"0\" /><br /><p>相信很多看见这个标题点击进来看文章站长朋友一定是对更新文章多少有点感触了！我也是，我一直认为更新文章是个体力活。费时费力，可能还没有多少流\r\n量进账！做网站很辛苦地球的站长都知道，更新网站更不是一朝一夕的事！曾几何时，更新网站成了站长的每天的作业，每天的必修课。多少站长为了在自己的 \r\n网站加点原创内容不眠不休，没日没夜。很多人都说我们站长是互联网的民工，每天更新文章这种机器的动作无异于民工板砖！每天ctrl+c，ctrl+v很\r\n 累，确实很累！但是今天我想说的是，我们能不能换一种心态去更新自己的网站！把更新网站当做是一件乐趣！</p>\r\n<p>话题转移到我最近做的一个美女博客，拽个CMS \r\n找几个样板站就开始狂采，但是现在看来这么做美女站简直是白费力气！以前最令我头疼的就是每天登陆后台审核一片片的垃圾美女文章，看着那白花花的大腿有点\r\n麻木了！更气人的是我采集的文章几乎不会给我带来长尾流量，做着做着就没有信心了，灰心了！域名到期了，站也跟着到期了！所以告别了一段美女站后，我又重\r\n \r\n新拾起这个主题，大家可以去我的MM美女博客看看文章，这些文章不是采集的，而是我一篇篇的亲手加上去的，算是为原创把！我现在每天的工作就是累了去一些\r\n \r\n门户的美女站看看美女文章，感觉哪个美女会火，或者我感兴趣就把她加进我的美女博客！标题的命名方式我一般式把这个女的名字在百度搜索下，根据底下的相关\r\n 搜索来为文章定位！这样说大家明白吗？而且内容都是我感兴趣的，这样我加其文章来就不觉得那么累了！看美女，加文章我说是一种享受也不过分吧！</p>\r\n对于这个美女博客我的整体优化思路我不是去专门优化大流量的关键字，我个人觉得当你把那种美女，MM，妹妹这种关键字优化上去后，你的站又有那 \r\n种暴露图片，离被百度人工删除就不远了！所以抓住长尾流量我觉得是优化美女站的关键！比如对网站目录结构的优化，文章TAG的命名优化！站初期没什么权重\r\n 就自己去其他论坛签名AD一下，等有一定文<br /><p>相信很多看见这个标题点击进来看文章站长朋友一定是对更新文章多少有点感触了！我也是，我一直认为更新文章是个体力活。费时费力，可能还没有多少流\r\n量进账！做网站很辛苦地球的站长都知道，更新网站更不是一朝一夕的事！曾几何时，更新网站成了站长的每天的作业，每天的必修课。多少站长为了在自己的 \r\n网站加点原创内容不眠不休，没日没夜。很多人都说我们站长是互联网的民工，每天更新文章这种机器的动作无异于民工板砖！每天ctrl+c，ctrl+v很\r\n 累，确实很累！但是今天我想说的是，我们能不能换一种心态去更新自己的网站！把更新网站当做是一件乐趣！</p>\r\n<p>话题转移到我最近做的一个美女博客，拽个CMS \r\n找几个样板站就开始狂采，但是现在看来这么做美女站简直是白费力气！以前最令我头疼的就是每天登陆后台审核一片片的垃圾美女文章，看着那白花花的大腿有点\r\n麻木了！更气人的是我采集的文章几乎不会给我带来长尾流量，做着做着就没有信心了，灰心了！域名到期了，站也跟着到期了！所以告别了一段美女站后，我又重\r\n \r\n新拾起这个主题，大家可以去我的MM美女博客看看文章，这些文章不是采集的，而是我一篇篇的亲手加上去的，算是为原创把！我现在每天的工作就是累了去一些\r\n \r\n门户的美女站看看美女文章，感觉哪个美女会火，或者我感兴趣就把她加进我的美女博客！标题的命名方式我一般式把这个女的名字在百度搜索下，根据底下的相关\r\n 搜索来为文章定位！这样说大家明白吗？而且内容都是我感兴趣的，这样我加其文章来就不觉得那么累了！看美女，加文章我说是一种享受也不过分吧！</p>\r\n对于这个美女博客我的整体优化思路我不是去专门优化大流量的关键字，我个人觉得当你把那种美女，MM，妹妹这种关键字优化上去后，你的站又有那 \r\n种暴露图片，离被百度人工删除就不远了！所以抓住长尾流量我觉得是优化美女站的关键！比如对网站目录结构的优化，文章TAG的命名优化！站初期没什么权重\r\n 就自己去其他论坛签名AD一下，等有一定文<br /><p>相信很多看见这个标题点击进来看文章站长朋友一定是对更新文章多少有点感触了！我也是，我一直认为更新文章是个体力活。费时费力，可能还没有多少流\r\n量进账！做网站很辛苦地球的站长都知道，更新网站更不是一朝一夕的事！曾几何时，更新网站成了站长的每天的作业，每天的必修课。多少站长为了在自己的 \r\n网站加点原创内容不眠不休，没日没夜。很多人都说我们站长是互联网的民工，每天更新文章这种机器的动作无异于民工板砖！每天ctrl+c，ctrl+v很\r\n 累，确实很累！但是今天我想说的是，我们能不能换一种心态去更新自己的网站！把更新网站当做是一件乐趣！</p>\r\n<p>话题转移到我最近做的一个美女博客，拽个CMS \r\n找几个样板站就开始狂采，但是现在看来这么做美女站简直是白费力气！以前最令我头疼的就是每天登陆后台审核一片片的垃圾美女文章，看着那白花花的大腿有点\r\n麻木了！更气人的是我采集的文章几乎不会给我带来长尾流量，做着做着就没有信心了，灰心了！域名到期了，站也跟着到期了！所以告别了一段美女站后，我又重\r\n \r\n新拾起这个主题，大家可以去我的MM美女博客看看文章，这些文章不是采集的，而是我一篇篇的亲手加上去的，算是为原创把！我现在每天的工作就是累了去一些\r\n \r\n门户的美女站看看美女文章，感觉哪个美女会火，或者我感兴趣就把她加进我的美女博客！标题的命名方式我一般式把这个女的名字在百度搜索下，根据底下的相关\r\n 搜索来为文章定位！这样说大家明白吗？而且内容都是我感兴趣的，这样我加其文章来就不觉得那么累了！看美女，加文章我说是一种享受也不过分吧！</p>\r\n对于这个美女博客我的整体优化思路我不是去专门优化大流量的关键字，我个人觉得当你把那种美女，MM，妹妹这种关键字优化上去后，你的站又有那 \r\n种暴露图片，离被百度人工删除就不远了！所以抓住长尾流量我觉得是优化美女站的关键！比如对网站目录结构的优化，文章TAG的命名优化！站初期没什么权重\r\n 就自己去其他论坛签名AD一下，等有一定文<br />', '10', '', null, null, 'fda', '0', '0', '0', '0', '1327891715', '1327891796', 'fdas', 'fdsa', 'fdsafsa\r\nfdasfsa\r\nfdasfa', '50', '0', '0', '0', null, null);
INSERT INTO `gz_article` VALUES ('58', '37', '网站设计', '', '', '网站设计要注意的两个要点：整体风格和色彩搭配。<h2><a name=\"3_1\"></a><span>一、确定网站的整体风格</span></h2>　　网站的整体风格及其创意设计是最难以学习的。难就难在没有一个固定的模式可以参照和模仿。给你一个主题，任何两人都不可能设计出完全一样的网站。\r\n　　风格(style)是抽象的。是指站点的整体形象给浏览者的综合感受。这个“整体形象”包括站\r\n点的CI（标志、色彩、字体、标语）、版面布局、浏览方式、交互性、文字、语气、内容价值、存在意义、站点荣誉等等诸多因素。<br /><br />&nbsp;&nbsp; 举个例子：我们觉得网易是平\r\n易近人的，迪斯尼是生动活泼的，IBM是专业严肃的。这些都是网站给人们留下的不同感受。\r\n　　<br />&nbsp;&nbsp; 在这里，我提供给大家一些参考经验：\r\n　　<br />&nbsp;&nbsp; 1．将你的标志logo，尽可能的放在每个页面上最突出的位置。\r\n　　<br />&nbsp;&nbsp; 2．突出你的标准色彩。\r\n　　<br />&nbsp;&nbsp; 3．总结一句能反映贵站精髓的宣传标语！ \r\n　　<br />&nbsp;&nbsp; 4．相同类型的图像采用相同效果，比如说标题字都采用阴影效果，那么在网站中出现的所有标题字的阴影效果的设置应该是完全一致的！<h2><a name=\"3_2\"></a><span>二、网页色彩的搭配</span></h2>　　无论是平面设计，还是网页设计，色彩永远是最重要的一环。当我们距离显示屏较远的时候，我们看到的不是优美的版式或美丽的图片，而是网页的色彩。\r\n　　<br />&nbsp;&nbsp; 关于色彩的原理有许多，在此我们不可能一一阐述，大家可以看看相关设计书籍，有利于系统地理解。在此我们仅仅想告诉大家一些网页配色时的小技巧。\r\n　　<br />&nbsp;&nbsp; 1．用一种色彩。这里是指先选定一种色彩，然后调整透明度或者饱和度，这样的页面看起来色彩统一，有层次感。\r\n　　<br />&nbsp;&nbsp; 2．用两种色彩。先选定一种色彩，然后选择它的对比色。\r\n　　<br />&nbsp;&nbsp; 3．用一个色系。简单的说就是用一个感觉的色彩，例如淡蓝，淡黄，淡绿；或者土黄，土灰，蓝。<br />&nbsp;　　<br /><b>&nbsp; 在网页配色中，还要切记一些误区：</b>\r\n　　<br />&nbsp; 1．不要将所有颜色都用到，尽量控制在三至五种色彩以内。\r\n　　<br />&nbsp; 2．背景和前文的对比尽量要大(绝对不要用花纹繁复的图案作背景)，以便突出主要文字内容。\r\n　　<br />&nbsp; 3．色彩的鲜明性。网页的色彩要鲜艳，容易引人注目。', '13', '', null, null, '', '0', '1', '0', '0', '1326770760', '1326770822', '', '网站设计要能充分吸引访问者的注意力，让访问者产生视觉上的愉悦感。因此在网页创作的时候就必须将网站的整体设计与网页设计的相关原理紧密结合起来。网站设计是将策划案中的内容、网站的主题模式，以及结合自己的认识通过艺术的手法表现出来；而网页制作通常就是将网页设计师所设计出来的设计稿，按照W3C规范用html语言将其制作成网页格式', '', '50', '0', '0', '0', null, null);
INSERT INTO `gz_article` VALUES ('57', '25', '网站开发的一般流程', '', '', '最基本的网站建设流程网站开发基本流程<br /><br />&nbsp;1.需求分析：目标定位  用户分析  市场前景\r\n<br />&nbsp;2.平台规划：内容策划  界面策划  网站功能\r\n\r\n<br />&nbsp;3.项目开发：界面设计  程序设计  系统整合 \r\n\r\n<br />&nbsp;4.测试验收：项目人员测试   非项目人员测试  公开测试<br /><br /><br />\r\n<font color=\"red\">【需求分析】</font>目标定位：做这个网站干什么？这个网站的主要职能是什么？网站的用户对象是谁？他们用网站干什么？用户分析：网站主要用户的特点是什么？他们需要什么？他们厌恶什么？如何针对他们的特点引导他们？如何做好用户服务？市场前景：网站如同一个企业，它需要能养活自己。这是前提，否则任何惊天动地的目标都是虚无的。网站的市场结合点在哪里？<br /><br /><br />\r\n<font color=\"red\">【平台规划】</font>内容策划：这个网站要经营那些内容?其中分重点、主要和辅助性内容，这些内容在网站中具有各自的体现形式.内容划分好以后,就进行文字策划(取名) ,把每个内容包装成栏目.界面策划:结合网站的主题进行风格策划.如色彩包括主色、辅色、突出色，版式设计包括全局、导航、核心区、内容区、广告区、版权区及板块设计。网站功能：主要是管理功能和用户功能。管理功能是我们通常说的后台管理，关键是做到管理方便、智能化。而用户功能就是用户可以进行的操作，这涉及交互设计，它是人和网站对话的接口，非常重要。\r\n\r\n<br /><font color=\"red\">【项目开发】</font>界面设计：根据界面策划的原则，对网站界面进行设计及完善。程序设计：根据网站功能规划进行数据库设计和代码编写。系统整合：将程序于界面结合，并实施功能性调试。\r\n\r\n<br /><font color=\"red\">【测试验收】</font>项目人员测试：项目经理，监察员及项目开发人员一同根据前期规划对项目进行测试和检验。非项目人员测试：邀请非项目参与人员作为不同的用户角色对平台进行使用性测试。公开测试：网站开通，并接受网友的使用测试，设立反馈信息平台。收集意见和建议信息，针对平台存在的不足进行思考和完善。', '13', '', null, null, '', '0', '1', '0', '0', '1326770304', '1326770401', '', '', '', '50', '0', '0', '0', null, null);
INSERT INTO `gz_article` VALUES ('56', '38', '网络营销-快速提高网站知名度', '', '', '<h2>核心标准</h2>1、以网站帮助企业实现经营目标为网站建设目标霸者网络信息技术有限公司ceo余强认为：营销型企业网站一定是为了满足企业的某些方面的网络营销功能，比\r\n如面向客户服务为主的企业网站营销功能，以销售为主的企业网站营销功能，以国际市场开发为主动企业网站营销功能，以上简单列举均是以实现企业的经营目标为\r\n核心，从而通过网站这样的工具来实现其网站营销的价值。 \r\n<br />　　<br />2、良好的搜索引擎表现：企业网站另一个重要功能是网站推广功能，而搜索引擎是目前网民获取信\r\n息最重要的渠道，如果企业网站无法通过搜索引擎进行有效推广，那么这个企业网站从一定程度上来讲其营销性会大打折扣，所以营销型企业网站必然要解决企业网\r\n站的搜索引擎问题，也可以理解为搜索引擎优化的工作，在营销型企业网站解决方案中，搜索引擎优化工作为基础和长期的工作，从企业网站的策划阶段乃至从企业\r\n网络营销的战略规划阶段就已经开始，而其又贯穿于企业网站的整个运营过程。 \r\n　<br />　<br />3、良好的客户体验：企业网站最终面对的潜在客户与客户或说与本公司业务有关联的任何组织和个人，如何提升企业网站的客户体验是营销型企业网站必须考虑的重要问题。<br />&nbsp;　　<br />4、重视细节：细节本也是客户体验中一个重要的元素，由于其的重要性所以我们单独将其作为营销型企业网站的一个因素，在营销型网站的流程制定、内容维护、网站管理等都需要体现出来细节问题。 \r\n<br />　　<br />5、网站监控与管理：营销型网站的另一个因素是网站本身的监控功能与管理功能，最简单来说网站总需要加一段流量监测的代码吧，更多的管理特点就不多做介绍。<br /><br />', '13', '', null, null, '', '0', '1', '0', '0', '1326770007', '1326770007', '', '网站营销也称为网络营销，就是以国际互联网络为基础，利用数字化的信息和网络媒体的交互性来辅助营销目标实现的一种新型的市场营销方式', '', '50', '0', '0', '0', null, null);
INSERT INTO `gz_article` VALUES ('55', '24', '网站维护-来自我们无所能及的技术', '', '', '<h2><span>内容</span></h2>　 1、 服务器及相关软硬件的维护，对可能出现的问题进行评估，制定响应时间；\r\n　　<br />&nbsp;&nbsp; 2、 数据库维护，有效地利用数据是网站维护的重要内容，因此数据库的维护要受到重视；\r\n　　<br />&nbsp;&nbsp; 3、 内容的更新、调整等；\r\n　　<br />&nbsp;&nbsp; 4、 制定相关网站维护的规定，将网站维护制度化、规范化；\r\n　　<br />&nbsp;&nbsp; 5、 做好网站安全管理，防范黑客入侵网站，检查网站各个功能，链接是否有错。\r\n<h2><a name=\"2_1\"></a><span>网站维护的项目服务器的软硬件维护</span></h2>　　\r\n包括服务器、<a target=\"_blank\" href=\"http://baike.baidu.com/view/880.htm\">操作系统</a>、和Internet联接线路等等，以确保网站的24小时不间断正常运行。网站内容的更新一个好的网站需要定期或不定期地更新内容，才能不断地吸引更多的浏览者，增加访问量。\r\n<h2><a name=\"2_2\"></a><span>服务器软硬件维护</span></h2>　\r\n　计算机硬件在使用中常会出现一些问题，同样，网络设备也同样影响企业网站的工作效率，网络设备管理属于技术操作，非专业人员的误操作有可能导致整个企业\r\n网站瘫痪。 没有任何操作系统是绝对安全的。维护操作系统的安全必须不断的留意相关网站，及时的为系统安装升级包或者打上<a target=\"_blank\" href=\"http://baike.baidu.com/view/228.htm\">补丁</a>。\r\n<h2><a name=\"2_3\"></a><span>网站安全维护</span></h2>　　\r\n随着黑客人数日益增长和一些入侵<a target=\"_blank\" href=\"http://baike.baidu.com/view/37.htm\">软件</a>昌盛，网站的安全日益遭到挑战，像SQL注入、跨站<a target=\"_blank\" href=\"http://baike.baidu.com/view/54.htm\">脚本</a>、文本上传漏洞等，而网站安全维护也成日益重视的模块。而网站安全的隐患主要是源于网站的漏洞存在，而世界上不存在没有漏洞网站，所以网站安全维护关键在于早发现漏洞和及时修补漏洞。而网上也有专门的<a target=\"_blank\" href=\"http://baike.baidu.com/view/4546513.htm\">网站漏洞扫描工具</a>，如亿思网站安全检测平台，而发现漏洞要及时修补，特别采用一些开放源码的网站。\r\n<h2><a name=\"2_4\"></a><span>网站内容更新</span></h2>　\r\n　建站容易维护难。对于网站来说，只有不断地更新内容，才能保证网站的生命力，否则网站不仅不能起到应有的作用，反而会对企业自身形象造成不良影响。如何\r\n快捷方便地更新网页，提高更新效率，是很多网站面临的难题。现在网页制作工具不少，但为了更新信息而日复一日地编辑网页，对信息维护人员来说，疲于应付是\r\n普遍存在的问题。 内容更新是网站维护过程中的一个瓶颈。网站的建设单位可以考虑从以下五个方面入手，使网站能长期顺利地运转。 \r\n　　<br />&nbsp;&nbsp;&nbsp; 1、在网站建设初期，就要对后续维护给予足够的重视，要保证网站后续维护所需资金和人力。很多单位是以外包项目的方式建设网站的，建设时很舍得投入资金。可是网站发布后，维护力度不够，信息更新工作迟迟跟不上。网站建成之时，便是网站死亡的开始。\r\n　　<br />&nbsp;&nbsp;&nbsp; 2、要从<a target=\"_blank\" href=\"http://baike.baidu.com/view/673434.htm\">管理制度</a>上保证信息渠道的通畅和信息发布流程的合理性。网站上各栏目的信息往往来源于多个业务部门，要进行统筹考虑，确立一套从信息收集、信息审查到信息发布的良性运转的管理制度。既要考虑信息的准确性和安全性，又要保证信息更新的及时性。要解决好这个问题，领导的重视是前提。 \r\n　　<br />&nbsp;&nbsp;&nbsp; 3、在建设过程中要对网站的各个栏目和子栏目进行尽量细致的规划，在此基础上确定哪些是经常要更新的内容，哪些是相对稳定的内容。由承建单位根据相对稳定的内容设计网页模板，在以后的维护工作中，这些模板不用改动，这样既省费用，又有利于后续维护。 \r\n　　<br />&nbsp;&nbsp;&nbsp; 4、对经常变更的信息，尽量用结构化的方式（如建立数据库、规范存放路径）管理起来，以避免数据杂乱无章的现象。如果采用基于数据库的动态网页方案，则在网站开发过程中，不但要保证信息浏览环境的方便性，还要保证信息维护环境的方便性。 \r\n　　<br />&nbsp;&nbsp;&nbsp; 5、要选择合适的网页更新工具。信息收集起来后，如何\"写到\"网页上去，采用不同的方法，效率也会大大不同。比如使用Notepad直接编辑HTML文档与用Dreamweaver等<a target=\"_blank\" href=\"http://baike.baidu.com/view/3982458.htm\">可视化工具</a>相比，后者的效率自然高得多。倘若既想把信息放到网页上，又想把信息保存起来以备以后再用，那么采用能够把网页更新和<a target=\"_blank\" href=\"http://baike.baidu.com/view/600155.htm\">数据库管理</a>结合起来的工具效率会更高。\r\n　　<br />&nbsp;&nbsp;&nbsp; 6.网上还有一些人员专门为企业站提供维护支持,例如: 在百度里面搜索\"易尚互联\".这样类型的网站<h2><span><a href=\"http://baike.baidu.com/view/1551732.htm#\" class=\"nslog:1019\">编辑本段</a></span><a name=\"3\"></a><span>网站维护专业要求</span></h2>　　熟悉网站前台相关技术，熟悉<a target=\"_blank\" href=\"http://baike.baidu.com/view/733.htm\">web2.0</a>相关技术；精通TCP/IP协议、<a target=\"_blank\" href=\"http://baike.baidu.com/view/38361.htm\">OSI参考模型</a>；\r\n熟悉HTML、DHTML、CSS、Javascript、ASP、JSP等web页面开发语、photoshop/Flash/Dreamweaver\r\n/Fireworks/等网站相关软件工具和数据库技术；具备较强的学习能力。需要懂得FTP上传下载，服务器维护，MSSQL/MYSQL数据库应用。\r\n　　网站维护需要网站程序员，编辑人员，图片处理人员，网页设计师，服务器维护专员!', '13', '', null, null, '网站维护,硬件维护', '0', '1', '0', '0', '1326769555', '1326769846', '', '网站维护是为了让您的网站能够长期稳定地运行在Internet上，及时地调整和更新您的网站内容，在瞬息万变的信息社会中抓住更多的网络商机。', '', '50', '0', '0', '0', null, null);
