INSERT INTO `gz_article` VALUES ('9', '32', '简洁入门型网页设计套餐', 'photos/articlephoto/201201/13263545001326354500.gif', '', '<p>入门型网页设计套餐风格简洁明快，主要以静态页面为主，结构清晰，符合企业形象要求，网络营销的入门尝试。网站功能实用，可迅速投入使用。适用于产品或服务相对简单，产品数量少，不需要或基本不需要常更新网站内容的小企业或个人建立小型宣传网站。同时也适用于企业对某一单独产品或活动的专题网页设计。以简洁实用的内容展示和反映您公司的形象和情况... </p>\r\n<ul>\r\n<li>简洁网站设计风格、整体布局策划.. </li>\r\n<li>首页平面艺术图片形象页，可选首页FLASH形象入口.. </li>\r\n<li>精美网站页面设计 </li>\r\n<li>制作Logo动画或Banner动画（不包括企业Logo设计</li></ul>\r\n<hr />\r\n<table><tbody><tr>\r\n    <td style=\"text-align:center;\" rowspan=\"8\" width=\"210\" bgcolor=\"#FFFFFF\"><img src=\"http://192.168.1.189:8080/fenghuo/photos/articlephoto/201201/13263545001326354500.gif\" /></td>\r\n    <td bgcolor=\"#FFFFFF\" height=\"35\"><span><br /></span></td>\r\n  </tr>\r\n  <tr>\r\n    <td bgcolor=\"#FFFFFF\" height=\"35\"><span>适合类型： 适用于想通过建立网站宣传展示产品或服务,简单实用,清晰明确,直接向客户展示</span></td>\r\n  </tr>\r\n  <tr>\r\n\r\n    <td bgcolor=\"#FFFFFF\" height=\"35\"><span>基本配置： 国际/国内顶级域名1个 , 100M 高速虚拟主机</span></td>\r\n  </tr>\r\n  <tr>\r\n    <td bgcolor=\"#FFFFFF\" height=\"35\"><span>网站策划： 专人提供客户网站建设分析、量身定做建站方案、收集建站素材</span></td>\r\n  </tr>\r\n  <tr>\r\n    <td bgcolor=\"#FFFFFF\" height=\"35\"><span>网站维护： 全年免费维护 、24小时电话、EMAIL技术支持/咨询</span></td>\r\n\r\n  </tr>\r\n  <tr>\r\n    <td bgcolor=\"#FFFFFF\" height=\"35\"><span>免费赠送： ICP网站备案、访客统计系统</span></td>\r\n  </tr>\r\n  <tr>\r\n    <td bgcolor=\"#FFFFFF\" height=\"35\"><span>开发周期： 5至7个工作日</span></td>\r\n  </tr>\r\n  <tr>\r\n\r\n    <td bgcolor=\"#FFFFFF\" height=\"35\"><span>参考价格：<span> 1580</span> 元飞</span></td>\r\n  </tr>\r\n</tbody></table>', '85', '', null, null, '', '0', '1', '0', '0', '1326113250', '1327892896', '', '入门型网页设计套餐风格简洁明快，主要以静态页面为主，结构清晰，符合企业形象要求，网络营销的入门尝试。网站功能实用，可迅速投入使用。适用于产品或服务相对简单，产品数量少，不需要或基本不需要常更新网站内容的小企业或个人建立小型宣传网站。', '简洁网站设计风格、整体布局策划\r\n首页平面艺术图片形象页，可选首页FLASH形象入口\r\n精美网站页面设计\r\n制作Logo动画或Banner动画（不包括企业Logo设计', '50', '0', '0', '0', null, null);
