INSERT INTO `gz_gift_bag` VALUES ('6', '小米（MI）小米移动电源 大容量16000mAh 双USB输出 高品质电芯 全铝合金金属外壳', 'photos/jinkuihuatop/goods/201510/14461089681446108968.jpg', 'photos/jinkuihuatop/goods/201510/thumb_b/14461089571446108957.jpg', 'photos/jinkuihuatop/goods/201510/14461089571446108957.jpg', '<div class=\"section section-bn xm-animation xm-animation-active\" style=\"color:#616161;\">\r\n	<div class=\"container\" style=\"text-align:center;margin-left:auto;\">\r\n		<div class=\"content\">\r\n			<p class=\"tip\" style=\"font-size:14px;color:red;\">\r\n				<br />\r\n			</p>\r\n		</div>\r\n	</div>\r\n	<div class=\"stage\" style=\"text-align:center;margin-left:-720px;\">\r\n	</div>\r\n</div>\r\n<div class=\"section section-capacity xm-animation xm-animation-active\" style=\"color:#616161;background-color:#f7f7f7;\">\r\n	<div class=\"container\" style=\"margin-left:auto;\">\r\n		<div class=\"content\" style=\"margin:0px 160px 0px auto;\">\r\n			<h3 class=\"title\" style=\"font-size:36px;font-family:FZLTXHK, \'Microsoft Yahei\', \'Hiragino Sans GB\', \'Heiti SC\', \'WenQuanYi Micro Hei\', SimSun, sans-serif;font-weight:400;color:#424242;\">\r\n				<div style=\"text-align:center;\">\r\n					<span style=\"line-height:1.5;\">16000mAh超大电量</span> \r\n				</div>\r\n				<div style=\"text-align:center;\">\r\n					<span style=\"line-height:1.5;\">能量密度达725Wh/L</span> \r\n				</div>\r\n			</h3>\r\n			<p class=\"text\" style=\"text-align:center;\">\r\n				采用 LG / 松下等国际高品质供应商原装定制电芯，能量密度可达 725Wh/L。16000mAh 超大电量为你的手机、平板、数码相机提供超乎想象的续航时间。可为小米手机 4（3080mAh）提供约 3.5 次充电。\r\n			</p>\r\n		</div>\r\n		<div class=\"feature-list-wrap\">\r\n			<ul class=\"feature-list clearfix\" style=\"font-size:16px;color:#757575;\">\r\n				<li class=\"first\" style=\"text-align:center;\">\r\n					<span class=\"data\" style=\"font-size:22px;color:#88b7d5;\"><b class=\"num-text J_jumpNumber\">3.5</b>次</span>小米手机 4 充电\r\n				</li>\r\n				<li style=\"text-align:center;\">\r\n					<span class=\"data\" style=\"font-size:22px;color:#88b7d5;\"><b class=\"num-text J_jumpNumber\">5</b>次</span>iPhone 6 充电\r\n				</li>\r\n				<li style=\"text-align:center;\">\r\n					<span class=\"data\" style=\"font-size:22px;color:#88b7d5;\"><b class=\"num-text J_jumpNumber\">2.5</b>次</span>iPad mini 充电\r\n				</li>\r\n			</ul>\r\n			<p class=\"tips\" style=\"font-size:12px;color:#b0b0b0;text-align:center;\">\r\n				* 以上数据均为实验室测定值，实际使用会根据具体情况略有不同。\r\n			</p>\r\n		</div>\r\n	</div>\r\n</div>\r\n<div class=\"section section-compatibility xm-animation xm-animation-active\" style=\"color:#616161;\">\r\n	<p>\r\n		<p>\r\n			<h3 class=\"title\" style=\"font-size:36px;font-family:FZLTXHK, \'Microsoft Yahei\', \'Hiragino Sans GB\', \'Heiti SC\', \'WenQuanYi Micro Hei\', SimSun, sans-serif;font-weight:400;color:#424242;\">\r\n				兼容主流手机与平板电脑<span class=\"subtitle\" style=\"font-size:16px;font-family:FZLTXHK, \'Microsoft Yahei\', \'Hiragino Sans GB\', \'Heiti SC\', \'WenQuanYi Micro Hei\', SimSun, sans-serif;color:#616161;\">充电口可自动调节输出电量</span> \r\n			</h3>\r\n			<p class=\"text\">\r\n				小米移动电源可根据被充电的设备，自动调节输出电量。全面兼容小米、苹果、三星、HTC、Google 甚至黑莓等手机及平板电脑，还可为部分数码相机及游戏掌机充电。小伙伴们再多也不怕。\r\n			</p>\r\n			<p>\r\n				<a href=\"http://bbs.xiaomi.cn/thread-8829835-1-1.html\" target=\"_blank\">兼容性详解 ?</a> \r\n			</p>\r\n			<p>\r\n				<br />\r\n			</p>\r\n		</p>\r\n		<p style=\"text-align:center;\">\r\n			<img src=\"/photos/jinkuihuatop/attached/image/20151126/20151126154104_47240.png\" alt=\"\" />\r\n		</p>\r\n		<p>\r\n			<br />\r\n		</p>\r\n	</p>\r\n</div>\r\n<div class=\"section section-charge xm-animation xm-animation-active\" style=\"color:#616161;background-color:#f7f7f7;\">\r\n</div>\r\n<div class=\"section section-io xm-animation xm-animation-active\" style=\"color:#616161;\">\r\n	<p>\r\n		<p>\r\n			<h3 class=\"title\" style=\"font-size:36px;font-family:FZLTXHK, \'Microsoft Yahei\', \'Hiragino Sans GB\', \'Heiti SC\', \'WenQuanYi Micro Hei\', SimSun, sans-serif;font-weight:400;color:#424242;\">\r\n				5.1V/3.6A 双口输出\r\n			</h3>\r\n			<p class=\"text\">\r\n				双口同时输出时可达 5.1V/3.6A,比普通双口移动电源输出量更大，同时为两台设备充电速度更快。\r\n			</p>\r\n			<p class=\"text\">\r\n				<br />\r\n			</p>\r\n			<p class=\"text\">\r\n				<br />\r\n			</p>\r\n		</p>\r\n		<p>\r\n			<p style=\"text-align:center;\">\r\n				<img src=\"/photos/jinkuihuatop/attached/image/20151126/20151126154118_99571.jpg\" alt=\"\" />\r\n			</p>\r\n			<p style=\"text-align:center;\">\r\n				<br />\r\n			</p>\r\n			<ul class=\"led-list\">\r\n				<li class=\"led-1\">\r\n				</li>\r\n				<li class=\"led-2\">\r\n				</li>\r\n				<li class=\"led-3\">\r\n				</li>\r\n				<li class=\"led-4\">\r\n				</li>\r\n			</ul>\r\n			<ul class=\"text-list\">\r\n				<li class=\"led\">\r\n					电量指示灯\r\n				</li>\r\n				<li class=\"power\">\r\n					电量检查\r\n				</li>\r\n				<li class=\"usb-input\">\r\n					Micro USB 接口 （输入）\r\n				</li>\r\n				<li class=\"usb-output1\">\r\n					USB 接口（输出）\r\n				</li>\r\n				<li class=\"usb-output2\">\r\n					USB 接口（输出）\r\n				</li>\r\n			</ul>\r\n		</p>\r\n	</p>\r\n</div>\r\n<div class=\"section section-core xm-animation xm-animation-active\" style=\"color:#616161;text-align:center;\">\r\n	<div class=\"container\" style=\"margin-left:auto;\">\r\n		<div class=\"content\">\r\n			<h3 class=\"title\" style=\"font-size:36px;font-family:FZLTXHK, \'Microsoft Yahei\', \'Hiragino Sans GB\', \'Heiti SC\', \'WenQuanYi Micro Hei\', SimSun, sans-serif;font-weight:400;color:#424242;\">\r\n				高品质电路保护芯片<span class=\"subtitle\" style=\"font-size:16px;font-family:FZLTXHK, \'Microsoft Yahei\', \'Hiragino Sans GB\', \'Heiti SC\', \'WenQuanYi Micro Hei\', SimSun, sans-serif;color:#616161;line-height:1.5;\">9 重保护，源自美国德州仪器</span> \r\n			</h3>\r\n			<p class=\"text\">\r\n				采用知名模拟电路供应商美国德州仪器的 USB 智能控制芯片和充放电芯片。不仅提供 9 重电路保护，还能全面提升充放电效率。\r\n			</p>\r\n			<p class=\"picc\" style=\"color:#b0b0b0;\">\r\n				每款正品小米移动电源，均由中国人保财险承保。每人每笔承保额为 50 万元，让您用得更放心！\r\n			</p>\r\n			<ul class=\"core-feature-list clearfix\" style=\"text-align:left;\">\r\n				<li>\r\n					<h4 style=\"font-size:18px;font-weight:400;color:#424242;\">\r\n						温度保护\r\n					</h4>\r\n					<p style=\"font-size:12px;\">\r\n						加入了热敏电阻和温控处理机制，确保锂电池在安全的温度范围内工作。\r\n					</p>\r\n<span class=\"icon-feature icon-feature-1\"></span> \r\n				</li>\r\n				<li>\r\n					<h4 style=\"font-size:18px;font-weight:400;color:#424242;\">\r\n						短路保护\r\n					</h4>\r\n					<p style=\"font-size:12px;\">\r\n						加入保险丝器件，在异常短路时自动保护，防止主板和电池的毁损。\r\n					</p>\r\n<span class=\"icon-feature icon-feature-2\"></span> \r\n				</li>\r\n				<li>\r\n					<h4 style=\"font-size:18px;font-weight:400;color:#424242;\">\r\n						Reset 保护\r\n					</h4>\r\n					<p style=\"font-size:12px;\">\r\n						加入 Reset 的电路处理，当出现异常状况导致产品无法正常工作时，可通过按 Power 键的方式恢复正常工作。\r\n					</p>\r\n<span class=\"icon-feature icon-feature-3\"></span> \r\n				</li>\r\n				<li>\r\n					<h4 style=\"font-size:18px;font-weight:400;color:#424242;\">\r\n						输入过压保护\r\n					</h4>\r\n					<p style=\"font-size:12px;\">\r\n						通过 OVP 电路的处理，防止输入电压过高，以避免对后端电路造成损坏。\r\n					</p>\r\n<span class=\"icon-feature icon-feature-4\"></span> \r\n				</li>\r\n				<li>\r\n					<h4 style=\"font-size:18px;font-weight:400;color:#424242;\">\r\n						输入防反保护\r\n					</h4>\r\n					<p style=\"font-size:12px;\">\r\n						当数据线反插时，电路会自动中断工作，保护充电设备。\r\n					</p>\r\n<span class=\"icon-feature icon-feature-5\"></span> \r\n				</li>\r\n				<li>\r\n					<h4 style=\"font-size:18px;font-weight:400;color:#424242;\">\r\n						输出过流保护\r\n					</h4>\r\n					<p style=\"font-size:12px;\">\r\n						智能适时检测输出电流，当输出电流超出上限时，主动关闭输出，保护待充电设备。\r\n					</p>\r\n<span class=\"icon-feature icon-feature-6\"></span> \r\n				</li>\r\n				<li>\r\n					<h4 style=\"font-size:18px;font-weight:400;color:#424242;\">\r\n						输出过压保护\r\n					</h4>\r\n					<p style=\"font-size:12px;\">\r\n						智能适时检测输出电压，当输出电压超出上限时，主动关闭输出，保护待充电设备。\r\n					</p>\r\n<span class=\"icon-feature icon-feature-7\"></span> \r\n				</li>\r\n				<li>\r\n					<h4 style=\"font-size:18px;font-weight:400;color:#424242;\">\r\n						电池过充过放保护\r\n					</h4>\r\n					<p style=\"font-size:12px;\">\r\n						加入日系专用锂电保护器件，有效避免电池的过充过放，防止损伤电池。\r\n					</p>\r\n<span class=\"icon-feature icon-feature-8\"></span> \r\n				</li>\r\n				<li>\r\n					<h4 style=\"font-size:18px;font-weight:400;color:#424242;\">\r\n						电芯 PTC 保护\r\n					</h4>\r\n					<p style=\"font-size:12px;\">\r\n						进口电芯自带 PTC 保护电路，当温度和电流超出上限时，可有效控制电流，保护电芯安全。\r\n					</p>\r\n<span class=\"icon-feature icon-feature-9\"></span> \r\n				</li>\r\n			</ul>\r\n		</div>\r\n	</div>\r\n	<div class=\"stage\" style=\"text-align:center;margin-left:-720px;\">\r\n	</div>\r\n</div>\r\n<div class=\"section section-efficiency xm-animation xm-animation-active\" style=\"color:#616161;\">\r\n	<div class=\"container\" style=\"text-align:center;margin-left:auto;\">\r\n		<div class=\"content\">\r\n			<h3 class=\"title\" style=\"font-size:36px;font-family:FZLTXHK, \'Microsoft Yahei\', \'Hiragino Sans GB\', \'Heiti SC\', \'WenQuanYi Micro Hei\', SimSun, sans-serif;font-weight:400;color:#424242;\">\r\n				全面优化充放电效率<span class=\"subtitle\" style=\"font-size:16px;font-family:FZLTXHK, \'Microsoft Yahei\', \'Hiragino Sans GB\', \'Heiti SC\', \'WenQuanYi Micro Hei\', SimSun, sans-serif;color:#616161;\">93% 的板端转化率</span> \r\n			</h3>\r\n			<p class=\"text\">\r\n				高品质电路芯片不仅更安全，更能有效提升充电转化率、稳定放电电压，并拥有高精度的阻容感器件。比普通移动电源更好充、更耐用。\r\n			</p>\r\n<img class=\"product\" style=\"width:270px;\" alt=\"\" src=\"http://c1.mifile.cn/f/i/2014/cn/goods/dianyuan16000/intro-efficiency.png\" width=\"270\" height=\"269\" /> \r\n			<ul class=\"feature-list clearfix\" style=\"color:#757575;\">\r\n				<li class=\"first\" style=\"font-size:16px;color:#88b7d5;\">\r\n					<span class=\"data\" style=\"line-height:1.25;\"><span class=\"num-wrap\">增加<b class=\"num-text J_jumpNumber\">100</b></span>次</span>使用寿命\r\n				</li>\r\n				<li style=\"font-size:16px;color:#88b7d5;\">\r\n					<span class=\"data\" style=\"line-height:1.25;\"><span class=\"num-wrap\">提升<b class=\"num-text J_jumpNumber\">10</b></span>%</span>电量输出效率\r\n				</li>\r\n				<li style=\"font-size:16px;color:#88b7d5;\">\r\n					<span class=\"data\" style=\"line-height:1.25;\"><span class=\"num-wrap\">高达<b class=\"num-text J_jumpNumber\">93</b></span>%</span>板端转化率\r\n				</li>\r\n				<li style=\"font-size:16px;color:#88b7d5;\">\r\n					<span class=\"data\" style=\"line-height:1.25;\"><span class=\"num-wrap\">最低<b class=\"num-text J_jumpNumber\">10000</b></span>mAh</span>实际输出容量\r\n				</li>\r\n			</ul>\r\n		</div>\r\n		<p class=\"tips\" style=\"font-size:12px;color:#b0b0b0;text-align:left;\">\r\n			* 实际输出容量测试条件：5V/1A 输出，25℃，以 LG 电芯为样本\r\n		</p>\r\n	</div>\r\n</div>\r\n<div class=\"section section-body xm-animation xm-animation-active\" style=\"color:#616161;\">\r\n	<div class=\"container\" style=\"margin-left:auto;\">\r\n		<div class=\"content\" style=\"margin:0px 125px 0px auto;\">\r\n			<h3 class=\"title\" style=\"font-size:36px;font-family:FZLTXHK, \'Microsoft Yahei\', \'Hiragino Sans GB\', \'Heiti SC\', \'WenQuanYi Micro Hei\', SimSun, sans-serif;font-weight:400;color:#424242;\">\r\n				CNC 镂边工艺提升使用手感\r\n			</h3>\r\n			<p class=\"text\">\r\n				在承接原有全铝合金金属表面处理工艺的基础上，更贴心地在壳体两端增加了 CNC 镂边工艺，并进行磨砂工艺处理，使原本是直角的金属边缘变得圆润柔和，全面提升使用手感。\r\n			</p>\r\n			<ul class=\"feature-list\" style=\"color:#757575;\">\r\n				<li>\r\n					<h4 style=\"font-size:24px;font-weight:400;color:#424242;\">\r\n						圆弧边缘\r\n					</h4>\r\n					<p>\r\n						符合人体工程学，相比普通产品的棱角边缘，更易于单手持握。\r\n					</p>\r\n				</li>\r\n				<li>\r\n					<h4 style=\"font-size:24px;font-weight:400;color:#424242;\">\r\n						阳极氧化工艺\r\n					</h4>\r\n					<p>\r\n						采用与 iPhone 5s 一致的阳极氧化工艺，可在表面形成坚硬的保护层，不掉色，更加耐磨耐腐蚀。\r\n					</p>\r\n				</li>\r\n				<li>\r\n					<h4 style=\"font-size:24px;font-weight:400;color:#424242;\">\r\n						隐藏式按键\r\n					</h4>\r\n					<p>\r\n						稍稍下凹的按键，看不到，但轻轻一摸就能找到。\r\n					</p>\r\n				</li>\r\n			</ul>\r\n		</div>\r\n	</div>\r\n</div>\r\n<div class=\"section section-shell xm-animation xm-animation-active\" style=\"color:#616161;background-color:#f7f7f7;\">\r\n	<div class=\"container\" style=\"margin-left:auto;\">\r\n		<div class=\"content\" style=\"margin:0px 0px 0px 10px;\">\r\n			<h3 class=\"title\" style=\"font-size:36px;font-family:FZLTXHK, \'Microsoft Yahei\', \'Hiragino Sans GB\', \'Heiti SC\', \'WenQuanYi Micro Hei\', SimSun, sans-serif;font-weight:400;color:#424242;\">\r\n				全铝合金金属外壳<span class=\"subtitle\" style=\"font-size:16px;font-family:FZLTXHK, \'Microsoft Yahei\', \'Hiragino Sans GB\', \'Heiti SC\', \'WenQuanYi Micro Hei\', SimSun, sans-serif;color:#424242;\">与 MacBook Pro 一致的表面工艺。</span> \r\n			</h3>\r\n			<p class=\"text\">\r\n				采用与 MacBook Pro 一致的表面工艺，CNC 高精度数控机床切割，一体成型金属外壳。超高的结构强度，耐摔防撞，可承受 2000 次坐压撞击。表面更可防汗防腐蚀，适宜随身携带。\r\n			</p>\r\n			<p>\r\n				<a href=\"http://bbs.xiaomi.cn/thread-8831659-1-1.html\" target=\"_blank\">看看铝合金外壳好在哪 ?</a> \r\n			</p>\r\n			<ul class=\"feature-list clearfix\" style=\"font-size:16px;color:#757575;\">\r\n				<li class=\"first\">\r\n					<span class=\"data\" style=\"font-size:24px;color:#88b7d5;line-height:1;\"><b class=\"num-text J_jumpNumber\">50</b>公斤</span>可承重重量\r\n				</li>\r\n				<li>\r\n					<span class=\"data\" style=\"font-size:24px;color:#88b7d5;line-height:1;\"><b class=\"num-text J_jumpNumber\">300</b>次</span>耐磨测试\r\n				</li>\r\n			</ul>\r\n		</div>\r\n		<p class=\"tips\" style=\"font-size:12px;color:#b0b0b0;\">\r\n			* 因拍摄角度与屏幕色差问题，最终产品以收到的实物为准。\r\n		</p>\r\n	</div>\r\n</div>\r\n<div class=\"section section-acc xm-animation xm-animation-active\" style=\"color:#616161;\">\r\n	<div class=\"stage clearfix\">\r\n		<div class=\"col-l\">\r\n			<div class=\"content\" style=\"color:#ffffff;text-align:right;\">\r\n				<h2 class=\"title\" style=\"font-size:28px;font-family:FZLTXHK, \'Microsoft Yahei\', \'Hiragino Sans GB\', \'Heiti SC\', \'WenQuanYi Micro Hei\', SimSun, sans-serif;font-weight:400;color:#ffffff;\">\r\n					炎炎\r\n				</h2>\r\n			</div>\r\n		</div>\r\n		<div class=\"figure figure-led\" style=\"color:#616161;background-color:#ffffff;\">\r\n		</div>\r\n<br class=\"Apple-interchange-newline\" />\r\n	</div>\r\n</div>', '1445404050', '11');
