INSERT INTO `gz_wx_article` VALUES ('23', '', '1', ' 代还信用卡服务协议', '', '', '<p style=\"text-align:center;\" align=\"center\"><b><span style=\"font-size:16pt;\">代还信用卡服务协议</span><span><br />\r\n<br />\r\n</span></b></p>\r\n<p><span><br />\r\n<span style=\"font-size:14px;\">&nbsp;</span></span><span style=\"font-size:14px;\">（</span><span style=\"font-size:14px;\">1</span><span style=\"font-size:14px;\">）代还信用卡服务协议（以下简称</span><span style=\"font-size:14px;\">“</span><span style=\"font-size:14px;\">本协议</span><span style=\"font-size:14px;\">”</span><span style=\"font-size:14px;\">）是义乌市收银网络科技有限公司（以下简称</span><span style=\"font-size:14px;\">“</span><span style=\"font-size:14px;\">收银服务</span><span style=\"font-size:14px;\">”</span><span style=\"font-size:14px;\">）与用户</span><span style=\"font-size:14px;\">(</span><span style=\"font-size:14px;\">以下简称</span><span style=\"font-size:14px;\">“</span><span style=\"font-size:14px;\">用户</span><span style=\"font-size:14px;\">”</span><span style=\"font-size:14px;\">或</span><span style=\"font-size:14px;\">“</span><span style=\"font-size:14px;\">您</span><span style=\"font-size:14px;\">”)</span><span style=\"font-size:14px;\">就代还信用卡服务的使用等相关事宜所订立的有效协议。在此特别提醒您认真阅读并充分理解本协议各条款，特别是免除或限制微刷的责任、限制您的权利、规定争议解决方式的相关条款。您使用本服务，即表示您与收银服务已达成协议并同意接受本协议的全部内容。</span></p>\r\n<p><span style=\"font-size:14px;\">&nbsp;</span><span style=\"font-size:14px;\">（</span><span style=\"font-size:14px;\">2</span><span style=\"font-size:14px;\">）代还信用卡服务指的是用户利用一张信用卡（信用卡</span><span style=\"font-size:14px;\">A</span><span style=\"font-size:14px;\">）在</span><span style=\"font-size:14px;\">APP</span><span style=\"font-size:14px;\">、公众号（如“收银服务”）、微信</span><span style=\"font-size:14px;\">H5</span><span style=\"font-size:14px;\">页面等应用上利用上述应用提供的快捷支付方法将额度转换为用户账户中余额，并利用该余额偿还信用卡</span><span style=\"font-size:14px;\">A</span><span style=\"font-size:14px;\">需要偿还的款项的服务。（请注意，如果用户的信用卡额度已用完，则无法进行此服务。）</span></p>\r\n<p><span style=\"font-size:14px;\">&nbsp;</span><span style=\"font-size:14px;\">（</span><span style=\"font-size:14px;\">3</span><span style=\"font-size:14px;\">）您使用本服务或者点击同意</span><span style=\"font-size:14px;\">/</span><span style=\"font-size:14px;\">确认行为即表示您授权委托收银服务代您与您所持信用卡发卡行签署代扣协议，同时授权信用卡发卡行有权按照收银服务的扣划指令从您的相应信用卡账户中扣划相应款项。</span><span style=\"font-size:14px;\"><br />\r\n&nbsp; (4</span><span style=\"font-size:14px;\">）您应确保您是使用本服务的信用卡持有人，可合法、有效使用该信用卡且未侵犯任何第三方合法权益，不得冒用他人信用卡进行信用卡诈骗行为，否则因此造成收银服务、持卡人损失的，您应负责赔偿并承担全部法律责任，包括但不限于冻结您全部或部分帐户</span><span style=\"font-size:14px;\">(</span><span style=\"font-size:14px;\">含该账户之关联账户</span><span style=\"font-size:14px;\">)</span><span style=\"font-size:14px;\">及资金并从您的前述账户中扣除相应的款项等，所应承担的赔偿范围包括但不限于实际经济损失、商业信誉损失、诉讼费、律师费、保全费、鉴定费、公证费、解决纠纷必要的人工费、差旅费、交通费、承担败诉风险时支付第三方的赔偿金等。</span></p>\r\n<p><span style=\"font-size:14px;\">&nbsp;</span><span style=\"font-size:14px;\">（</span><span style=\"font-size:14px;\">5</span><span style=\"font-size:14px;\">）您同意收银服务有权依据其自身判断对涉嫌欺诈或被他人控制并用于欺诈目的的账户采取相应的措施，上述措施包括但不限于冻结账户及资金、处置涉嫌欺诈的资金等。</span></p>\r\n<p><span style=\"font-size:14px;\">&nbsp;</span><span style=\"font-size:14px;\">（</span><span style=\"font-size:14px;\">6</span><span style=\"font-size:14px;\">）收银服务根据您的账户与您的银行卡信息及手机信息建立对应关联关系，您须妥善保管您的以上资料、密码等账户安全信息及银行卡号、有效期、安全码、证件号码、手机动态密码等敏感信息，不得将敏感信息向他人透露，因您对标识、信用卡信息、手机等保管不善产生的风险及损失由您本人承担。</span><span style=\"font-size:14px;\"><br />\r\n&nbsp;</span><span style=\"font-size:14px;\">（</span><span style=\"font-size:14px;\">7</span><span style=\"font-size:14px;\">）您应向收银服务提供您的真实姓名、身份证号、手机号、银行卡等个人信息，及时更新您正确、最新及完整的身份信息及相关资料。若收银服务有合理理由怀疑您提供的信息或相关资料错误、不实、过时或不完整的，有权暂停或终止向您提供部分或全部本服务。收银服务对此不承担任何责任，您将承担因此产生的任何直接或间接支出。因您未及时更新资料导致的一切后果，均应由您自行承担，该后果包括但不限于导致本服务无法提供或提供时发生任何错误、支付账户及该账户内余额被别人盗用，且您不得将此作为取消交易、拒绝付款的理由。</span></p>\r\n<p><span style=\"font-size:14px;\">&nbsp;</span><span style=\"font-size:14px;\">（</span><span style=\"font-size:14px;\">8</span><span style=\"font-size:14px;\">）您应当准确提供并及时更新您提供的联系方式，以便收银服务与您进行及时、有效联系。您应完全独自承担因通过这些联系方式无法与您取得联系而导致的您在使用本服务过程中遭受的任何损失或增加任何费用等不利后果。</span></p>\r\n<p><span style=\"font-size:14px;\">&nbsp; (9</span><span style=\"font-size:14px;\">）您同意并授权收银服务在法律允许的范围内收集和使用您的个人信息，并且将这些信息向收银服务选定的市场化征信服务机构进行披露，对您进行身份信息识别及背景调查以便为您提供更加安全、合规的综合化或专业化的服务，符合国家反洗钱相关法律法规的要求，并且您授权微刷及其关联公司有权通过收银服务选定的市场化征信服务机构或其他合法手段验证您的上述信息是否真实、准确和有效。这些信息包括但不限于：您的真实姓名、身份证号码、联系方式、信用状况、银行账号等。未经您的授权，收银服务不会向除收银服务及其关联公司或合作方以外的任何第三方透露您的银行卡号码、银行账户、其他金融信息或个人隐私信息，法律法规另有规定或监管机构、法院等有权单位依法请求的除外。</span></p>\r\n<p><span style=\"font-size:14px;\">&nbsp;</span><span style=\"font-size:14px;\">（</span><span style=\"font-size:14px;\">10</span><span style=\"font-size:14px;\">）收银服务仅提供您支付接口及后台运营系统，还款金额、行为请您按照信用卡发卡行的规则进行，概与收银服务无关。</span></p>\r\n<p><span style=\"font-size:14px;\">&nbsp; (11</span><span style=\"font-size:14px;\">）您在使用本服务时应当认真确认信用卡还款信息，包括且不限于还款金额、最后还款时间等，并按收银服务业务流程发出符合《代还信用卡服务协议》约定的指令。您发出的指令不可撤回或撤销，收银服务有权根据您的指令委托信用卡发卡行或第三方从信用卡中划扣资金。届时您不应以非本人意愿交易或其他任何原因要求收银服务退款或承担其他责任。</span></p>\r\n<p><span style=\"font-size:14px;\">&nbsp;</span><span style=\"font-size:14px;\">（</span><span style=\"font-size:14px;\">12</span><span style=\"font-size:14px;\">）您保证对您使用本服务所发出的指令的真实性和有效性负责，不得进行虚假交易、套取资金等违法违规行为。若您违反前述保证从而给微刷、信用卡发卡行或他人造成损失的，您应负责赔偿并承担全部法律责任（应赔偿的损失包括但不限于实际经济损失、商业信誉损失、诉讼费、律师费、保全费、鉴定费、公证费、解决纠纷必要的人工费、差旅费、交通费、承担败诉风险时支付第三方的赔偿金等）。</span></p>\r\n<p><span style=\"font-size:14px;\">&nbsp;</span><span style=\"font-size:14px;\">（</span><span style=\"font-size:14px;\">13</span><span style=\"font-size:14px;\">）收银服务有权基于业务调整或风险管控的需要，暂停、中断或终止向您提供本服务。您存在下列情形之一的，收银服务有权立即终止您使用相关服务而无需承担任何责任：</span><span style=\"font-size:14px;\">1.</span><span style=\"font-size:14px;\">您违反法律法规政策等规定的；</span><span style=\"font-size:14px;\">2.</span><span style=\"font-size:14px;\">您违反本协议约定的；</span><span style=\"font-size:14px;\">3.</span><span style=\"font-size:14px;\">您违反收银服务发布的使用本服务所必须遵守的协议、规则等相关规定的；</span><span style=\"font-size:14px;\">4. </span><span style=\"font-size:14px;\">收银服务认为向您提供本服务存在风险的。</span><span style=\"font-size:14px;\"><br />\r\n&nbsp; (14</span><span style=\"font-size:14px;\">）由于不可抗力或意外事件而影响收银服务正常的服务和技术支持时，不应该视为收银服务违约。不可抗力、意外事件是指不能预见、不能克服并不能避免且对一方或双方当事人造成重大影响的客观事件，包括但不限于自然灾害如洪水、地震、瘟疫流行和风暴等以及社会事件如战争、动乱、政府行为、管制以及其他如电信线路故障、银行系统调整或故障、突然停电等意外事件等。</span></p>\r\n<p><span style=\"font-size:14px;\">&nbsp;</span><span style=\"font-size:14px;\">（</span><span style=\"font-size:14px;\">15</span><span style=\"font-size:14px;\">）所有使用本服务而必须遵守的协议、附件和规则等均构成本协议不可分割的组成部分，与本协议具有同等法律效力。</span></p>\r\n<p><span style=\"font-size:14px;\">&nbsp;</span><span style=\"font-size:14px;\">（</span><span style=\"font-size:14px;\">16</span><span style=\"font-size:14px;\">）本协议的效力、解释、变更、执行及争议的解决适用中华人民共和国法律。就本协议所引起的任何争议和纠纷，均应由双方友好协商解决；如协商不成的，您和微刷均有权向微刷总部所在地广州市天河区有管辖权的人民法院提起诉讼。</span></p>\r\n<span style=\"font-family:DengXian;font-size:14px;\">&nbsp; </span><span style=\"font-family:DengXian;font-size:14px;\">（<span style=\"font-size:14px;\">17</span>）您同意，收银服务有权对本协议内容进行相应修改或变更，修改或变更后的协议内容即有效代替原来的协议，您在使用收银服务时须定期关注、注意协议内容并定期审阅本协议及其变更内容。若您不同意微刷对本协议所作的任何修改或变更，您应立即向收银服务申请停止使用本服务。若您在本协议内容<a name=\"_GoBack\"></a>变更后仍继续使用本服务，则表示您已充分阅读、理解、同意并接受修改或变更后的协议内容，也将遵循修改或变更后的协议内容使用本服务。</span>', '10', '0', '1', '1511420943', '1517501930', '', '50', 'img');
